import "./themify-icons/themify-icons.css";
function Navigation() {
    return (
        <ul>
        <li>
            <a href="#"><i className="ti-github"></i></a>
            </li>
        <li>
            <a href="#"><i className="ti-twitter-alt"></i></a>
            </li>
        <li>
            <a href="#"><i className="ti-linkedin"></i></a>
            </li>
            
        
    </ul>
    )
};
export default Navigation;
